import "./ExpensesList";
import ExpenseItem from "./ExpenseItem";
//
const ExpensesList = (props) => {
  //
  let expenseContent = <p>Nothing here folks!</p>;
  if (props.items.length > 0) {
    expenseContent = props.items.map((item) => {
      return (
        <ExpenseItem
          key={item.id}
          title={item.title}
          amount={item.amount}
          date={item.date}
        />
      );
    });
  }
  //
  return <ul className=""></ul>;
};

export default ExpensesList;
